import { faEye, faTrash } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import axios from 'axios';
import React, { useCallback, useEffect, useMemo, useState } from 'react';
import { useTable } from 'react-table';
import TableTax from '../../../components/Table/TableTax';

const Item = () => {
  const [item, setItem] = useState('');
  const [states, setStates] = useState('');
  const Loaditem = useCallback(async () => {
    const result = await axios.get('http://localhost:3003/item');
    // setStates([...new Set(result.data.map((x) => x.state))]);
    setItem(result.data);
    console.log('Item', item);
  }, [item]);
  const editUser = useCallback(
    async (e, rowIdx) => {
      e.preventDefault();
      await axios
        .put(`http://localhost:3003/item/${rowIdx}`, {})
        .then((response) => {
          console.log('response', response);
        })
        .catch((error) => {
          console.log('error', error);
        });
      Loaditem();
    },
    [Loaditem]
  );
  useEffect(() => {
    Loaditem();
  });
  const ITEMS_COLUMN = useMemo(() => {
    return [
      {
        Header: '#',
        accessor: 'id',
      },
      { Header: 'Name', accessor: 'name' },
      { Header: 'City', accessor: 'city' },
      { Header: 'State', accessor: 'state' },
      { Header: 'Contact No.', accessor: 'contact' },
      {
        Header: 'Actions',
        accessor: 'action',
        disableSortBy: true,
        Cell: (props) => {
          const rowIdx = props.row.original.id;
          return (
            <div className='d-flex justify-content-around'>
              <span
                onClick={(e) => {
                  deleteUser(e, rowIdx);
                }}>
                <FontAwesomeIcon className='icon' icon={faEye} />
              </span>
              <span onClick={() => {}}>
                <FontAwesomeIcon className='icon' icon={faTrash} />
              </span>
            </div>
          );
        },
      },
    ];
  }, []);
  const columns = useMemo(() => ITEMS_COLUMN, [ITEMS_COLUMN]);
  const data = useMemo(() => item, [item]);
  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    page,
    nextPage,
    previousPage,
    canNextPage,
    canPreviousPage,
    pageOptions,
    state,
    gotoPage,
    pageCount,
    setPageSize,
    prepareRow,
    setFilter,
  } = useTable(
    {
      ITEMS_COLUMN,
      item,
    },
    useFilters,
    useSortBy,
    usePagination
  );
  return item === '' ? (
    <div>{console.log('item in empty', item)}</div>
  ) : (
    <>
      <TableTax
        columns={columns}
        data={data}
        getTableProps={getTableProps}
        getTableBodyProps={getTableBodyProps}
        headerGroups={headerGroups}
        page={page}
        nextPage={nextPage}
        previousPage={previousPage}
        canNextPage={canNextPage}
        canPreviousPage={canPreviousPage}
        pageOptions={pageOptions}
        state={state}
        gotoPage={gotoPage}
        pageCount={pageCount}
        setPageSize={setPageSize}
        prepareRow={prepareRow}
        setFilter={setFilter}
        pageIndex={pageIndex}
        pageSize={pageSize}
      />
    </>
  );
};

export default Item;
